import React from "react";

function Searched() {
  const searchMovies = async (input: any) => {
    const api = await fetch(
      `https://api.themoviedb.org/3/search/${input}?page=1`
    );
  };
  searchMovies(input);

  return <div>Searched</div>;
}

export default Searched;
